package sticks;
import java.util.ArrayList;

/*
 * Include with Code Coverage.
 */
public class StickList {
	
	private ArrayList<Stick> sticks = new ArrayList<Stick>();
	
	public void add(Stick stick) {
		sticks.add(stick);
	}
	
	public void remove(int i) {
		if (i>=0 && i<sticks.size())
			sticks.remove(i);
	}
	
	public Stick get(int i) {
		if (i < 0 || i > sticks.size())
			return null;
		return sticks.get(i);
	}
	
	public void use(int number) {
		if (number > unused() || number < 0)
			return;
		for (int i=0; i<number; i++)
			sticks.get(size()-used()-1).use();
	}
	
	public void use() {
		use(1);
	}
	
	public void reset() {
		for (Stick stick : sticks)
			stick.unuse();
	}
	
	@Override
	public String toString() {
		String output = "";
		for (Stick stick : sticks)
			output += stick.toString();
		return output;
	}
	
	public int size()		{ return sticks.size(); }
	public int unused()		{ return size() - used(); }
	
	public int used() {
		int count = 0;
		for (Stick stick : sticks)
			if (stick.isUsed())
				count++;
		return count;
	}
	
	
	
}

package sticks;

/*
 * Include with Code Coverage.
 */
public class Stick {
	
	private boolean used = false;
	
	public boolean isUsed()				{ return used; }
	public void use()					{ used = true; }
	public void unuse()					{ used = false; }
	
	@Override
	public String toString() {
		if (used)
			return "-";
		else return "I";
	}
	
}

package sticks;
import java.util.Scanner;

/*
 * Include with Code Coverage.
 */
public class Player {
	
	private Scanner scan;

	public int draw() {
		System.out.print("(Enter 0 to quit) How many sticks do you want to draw? Choose 1, 2 or 3: ");
		int draw = readInput();
		if (draw < 0 || draw > 3)
				return -1;
		return draw;
	}
    
    private int readInput() {
    	scan = new Scanner(System.in);
    	try	{ return scan.nextInt(); }
    	catch(Exception e) {
    		System.err.println("Error with input, try again please.");
    		return -1;
    	}
    }
    
}

package sticks;
import static org.mockito.Mockito.*;
import java.util.Random;

/*
 * Include with Code Coverage.
 */
public class Main {
	
	public static void main(String[] args) {
		
		testStickList();
		testAI();
		testGameComponents();
		runManual();
		runAutomatically(100);
		runAutomaticallyWithStaticInput();
		System.out.println("\nReached end of program");
	}
	
	private static void runManual() {
		
		//Manual testing, requires input
		Game game = initGame(false);
		do { game.play(); } while (!game.isDone());
		
	}
	
	private static void runAutomatically(int runTimes) {
		
		//Run the program without need for input, for testing purposes.
		Game game = initGame(true);
		for (int i=0; i<runTimes; i++) {		//Will always run 100 times as set by the main method
			do {
				int answer = randomNumber(3, 1);
				when(game.getPlayer().draw()).thenReturn(answer);
				System.out.println("Mock Player draws: " + answer);
				game.play();
			} while (!game.isDone());
			game.restart();
		}
	}
	
	private static void runAutomaticallyWithStaticInput() {
		
		//Run the program without need for input, for testing purposes.
		Game game = initGame(true);
		game.restart();			//Should not work now
		for (int i=3; i>=0; i--)
			runStaticInput(game, i);
		game.play();			//One last run, which should not be running at all.
		
	}
	
	private static void runStaticInput(Game game, int answer) {
		when(game.getPlayer().draw()).thenReturn(answer);
		System.out.println("Mock Player draws: " + answer);
		game.play();
	}
	
	private static void testGameComponents() {
		Game game = initGame(false);
		game.getPlayer();
		game.getAI();
		game.getStickList();
	}
	
	private static void testStickList() {
		
		StickList list = new StickList();
		list.reset();
		list.toString();
		list.used();
		list.add(new Stick());
		
		list.reset();
		list.toString();
		list.used();
		list.add(new Stick());
		list.add(new Stick());
		
		list.use();
		list.use(0);
		list.use(1);
		list.use(2);
		list.use(-1);
		list.use(9);
		list.get(0);
		list.get(1);
		list.get(2);
		list.get(-1);
		list.get(9);
		list.remove(0);
		list.remove(1);
		list.remove(2);
		list.remove(-1);
		list.remove(9);
		
	}
	
	private static void testAI() {
		AI ai = new AI();
		ai.setMax(-1);
		ai.setMax(2);
	}
	
	private static Game initGame(boolean mock) {
		StickList list = new StickList();
		for (int i=0; i<30; i++)			//Will always run 30 times
			list.add(new Stick());
		if (mock)
			return new Game(list, mock(Player.class), new AI());
		else return new Game(list, new Player(), new AI());
	}
	
	private static int randomNumber(int value, int add) {
		Random rand = new Random();
		return  rand.nextInt(value) + add;
	}
	
}

package sticks;

public class Game {
	
	private StickList list;
	private Player player;
	private AI ai;
	private boolean done = false;
	
	public Game(StickList list, Player player, AI ai) {
		this.list = list;
		this.player = player;
		this.ai = ai;
	}
	
	public void restart() {
		if (done) {
			done = false;
			list.reset();
		}
	}
	
	public void play() {
		if (done)
			return;
		
		//Player
		int input = player.draw();
		if (!isValidDraw(input, 0, 3))
			return;
		if (input == 0) {
			System.out.println("Player ended game before it was finished.");
			done = true;
			return;
		}
		list.use(input);
		if (checkEndOfGame(true))
			return;
		
		//AI
		ai.setMax(list.unused());
		list.use(ai.draw());
		if (checkEndOfGame(false))
			return;
		
		printSticks();
	}
	
	public boolean isDone()					{ return done; }
	public Player getPlayer()				{ return player; }
	public Player getAI()					{ return ai; }
	public StickList getStickList()			{ return list; }
	
	
	
	private boolean isValidDraw(int value, int min, int max) {
		return (value >= min && value <= max && value < list.unused());
	}
	
	private boolean checkEndOfGame(boolean playerInput) {
		if (list.unused() == 1) {
			printSticks();
			done = true;
			if (!playerInput)
				System.out.println("Player loses, AI wins!\n");
			else System.out.println("Player wins, AI loses!\n");
		}
		return done;
	}
	
	private void printSticks() {
		System.out.print("Sticks remaining: " + list.toString() + "   (" + list.unused() +")\n\n");
	}
	
}

package sticks;
import java.util.Random;

/*
 * Include with Code Coverage.
 */
public class AI extends Player {
	
	private Random random = new Random();
	private int max = 1;
	
	public void setMax(int i) {
		if (i>0)
			max = i;
	}
	
	@Override
	public int draw() {
		if (max <= 2) {
			System.out.println("PC draws: 1");
			return 1;
		}
		else if (max == 3) {
			System.out.println("PC draws: 2");
			return 2;
		}
		else if (max == 4) {
			System.out.println("PC draws: 3");
			return 3;
		}
		else {
			int rand = random.nextInt(3) + 1;
			System.out.println("PC draws: " + rand);
			return rand;
		}
	}
}
